import { Link } from "react-router-dom";
import { navLinks } from "./navLinks";
import "./Navbar.css";

export default function Navbar() {
  return (
    <nav className="top-navbar">
      <div className="logo">
        <img src="/logo.png" alt="Logo" />
      </div>

      <ul className="nav-links">
        {navLinks.map((link) => (
          <li key={link.name}>
            <Link to={link.path}>{link.name}</Link>
          </li>
        ))}
      </ul>
    </nav>
  );
}
